    //         "trade_max_size": "0"
    //     }
    //
    // option
    //
    //     {
    //         "close_order": null,
    //         "size": 1,
    //         "vega": "5.29756",
    //         "theta": "-98.98917",
    //         "gamma": "0.00056",
    //         "delta": "0.68691",
    //         "contract": "BTC_USDT-20230602-26500-C",
